Bind.Script:
var component,output,decimals,unit;
function load(evt){
	component = evt.getTarget().getParentNode();
	output = "";
	var value;
	decimals = getDecimals(value);
	unit = component.getAttribute("Unit");
	component.setAttribute("Visibility","Hidden");

}

function signal(evt){
	component = evt.getTarget().getParentNode();
	component.setAttribute("Visibility","Visible");
	evt.preventDefault();
	value = new Number(evt.getValue());
	decimals = getDecimals(value);
	var unit = evt.getUnit();
	component.getChildByName("Unit").setAttribute("Content",unit);
	output = "";
	output += value.toFixed(decimals);

	if ((value >= 10000000) | (value <= -1000000) | isNaN(value))
		output = "-------";

	clearDigits();
	setDigits(output);
}

function getDecimals(value){

	decimals = parseInt(component.getAttribute("Decimals"));

	if ((value >= 1000000) | (decimals < 0))
		decimals = 0;
	else
		if ((value >= 100000) & (decimals > 1))
			decimals = 1;
		else
	if (value <= -100000)
		decimals = 0;
	else
		if ((value <= -10000) & (decimals > 1))
			decimals = 1;
		else
			if (decimals > 2)
				decimals = 2;		

	return decimals;
}

function setDigits(output){

	length = output.length;
	j = -1;

    for(i=length-1; i>=0; --i){
		display = output.slice(i,i+1);

		j++;

		digit = component.getChildByName("g"+j);
		decoder(digit,display);

		if (display == ".")
			j--;		
	}
}

function clearDigits(){
    for(i=0; i<=6; ++i){
		digit = component.getChildByName("g"+i);
		decoder(digit, " ");
		if ((i == 1) | (i == 2))
			digit.getChildByName("dp").setAttribute("Visibility", "Hidden");
	}
}

