Component.Script:
function onMouseOver(evt)
{
	target = evt.getCurrentTarget();
	scaleElements = target.getElementsByTagName("Scale");
	scale = null;
	for (i = 0; i < scaleElements.length; i++)
	{
		if (scaleElements.item(i).getAttribute("Name") 
			== "ElementBlowupScale")
		{
			scale = scaleElements.item(i);
		}
	}	
	if (scale == null) return;

	animate = scale.getElementsByTagName("Animate");

	for (i = 0; i < animate.length; i++)
	{
		animate.item(i).setAttribute("Animation", "Stop");

		from = scale.getAttribute("ScaleX");
		to = scale.getAttribute("Max");

		animate.item(i).setAttribute("From", from);
		animate.item(i).setAttribute("To", to);	

		animate.item(i).setAttribute("Animation", "Start");
	}

	moveToTop(target);
}

function onMouseOut(evt)
{
	target = evt.getCurrentTarget();
	restore(target);

	scaleElements = target.getElementsByTagName("Scale");
	scale = null;
	for (i = 0; i < scaleElements.length; i++)
	{
		if (scaleElements.item(i).getAttribute("Name") 
			== "ElementBlowupScale")
		{
			scale = scaleElements.item(i);
		}
	}	
	if (scale == null) return;

	animate = scale.getElementsByTagName("Animate");

	for (i = 0; i < animate.length; i++)
	{
		animate.item(i).setAttribute("Animation", "Stop");

		from = scale.getAttribute("ScaleX");
		to = scale.getAttribute("Min");

		animate.item(i).setAttribute("From", from);
		animate.item(i).setAttribute("To", to);	

		animate.item(i).setAttribute("Animation", "Start");
	}
}

var before = null;
function moveToTop(element)
{
	if (element == null) return;

	parent = element.getParentNode();
	if (parent == null) return;

	before = element.getNextSibling();

	parent.removeChild(element);
	parent.appendChild(element);
}
function restore(element)
{
	if (element == null) return;

	parent = element.getParentNode();
	if (parent == null) return;

	parent.insertBefore(element, before);
}

function onMouseClick(evt)
{
	var t = evt.getCurrentTarget();

	var WinTop = t.getChild("Window").getAttribute("Top");
	var WinLeft = t.getChild("Window").getAttribute("Left");   
	var WinHeight = t.getChild("Window").getAttribute("Height");
	var WinWidth = t.getChild("Window").getAttribute("Width");

	var linkname = evt.getCurrentTarget().getElementsByTagName("Link").item(0).getFullBindName();
	invoke(linkname,'OpenInFloatingWindow Width=' + WinWidth + '| Height=' + WinHeight + '| Top=' + WinTop + '| Left=' + WinLeft +'| ShowToolBar=Yes');
}

Bind.Script:
var component,output,decimals,unit;
function load(evt){
	component = evt.getTarget().getParentNode();
	output = "";
	var value;
	decimals = getDecimals(value);
	unit = component.getAttribute("Unit");
	component.setAttribute("Visibility","Hidden");

}

function signal(evt){
	component = evt.getTarget().getParentNode();
	component.setAttribute("Visibility","Visible");
	evt.preventDefault();
	value = new Number(evt.getValue());
	decimals = getDecimals(value);
	var unit = evt.getUnit();
	component.getChildByName("Unit").setAttribute("Content",unit);
	output = "";
	output += value.toFixed(decimals);

	if ((value >= 10000000) | (value <= -1000000) | isNaN(value))
		output = "-------";

	clearDigits();
	setDigits(output);
}

function getDecimals(value){

	decimals = parseInt(component.getAttribute("Decimals"));

	if ((value >= 1000000) | (decimals < 0))
		decimals = 0;
	else
		if ((value >= 100000) & (decimals > 1))
			decimals = 1;
		else
	if (value <= -100000)
		decimals = 0;
	else
		if ((value <= -10000) & (decimals > 1))
			decimals = 1;
		else
			if (decimals > 2)
				decimals = 2;		

	return decimals;
}

function setDigits(output){

	length = output.length;
	j = -1;

    for(i=length-1; i>=0; --i){
		display = output.slice(i,i+1);

		j++;

		digit = component.getChildByName("g"+j);
		decoder(digit,display);

		if (display == ".")
			j--;		
	}
}

function clearDigits(){
    for(i=0; i<=6; ++i){
		digit = component.getChildByName("g"+i);
